impl Solution {
    pub fn minimum_cost(nums: Vec<i32>, k: i32, dist: i32) -> i64 {
        let n = nums.len();
        let k = k as usize;
        let dist = dist as usize;
        let mut dp = vec![vec![i64::MAX; k + 1]; n + 1];
        dp[0][0] = 0;

        for i in 1..=n {
            dp[i][1] = nums[i - 1] as i64;
        }

        for j in 2..=k {
            for i in j..=n {
                let mut min_cost = i64::MAX;
                let start = if i > dist { i - dist } else { 1 };
                for l in start..i {
                    min_cost = min_cost.min(dp[l - 1][j - 1]);
                    dp[i][j] = dp[i][j].min(min_cost + nums[i - 1] as i64);
                }
            }
        }

        dp[n][k]
    }
}
